  import * as React from 'react';
  import Typography from '@mui/material/Typography';
  import Box from '@mui/material/Box';
  import Link from '@mui/material/Link';

  
  const Footer = () => {
    return(
  <Box sx={{ bgcolor: '#6ECCAF', p: 7 }} component="footer">
        <Box sx={{bgcolor:'red',width:'100px'}}>
        <Link href="/"  variant="body2" underline="always" sx={{color:"purple",size:"50px"}}>
                                        {"Home"}
                                      </Link>
        </Box>
       
      </Box>);}
      export default Footer;
